import './ContactUs.css';


function ContactUs() {
    return (
        <div className="contactus_main_container">
            <div className="contactus_title">
               <h2>Send Message</h2>
            </div>

            <div className="contactus_container">

            </div>
            

        </div>
    )
}

export default ContactUs
